// import EmojiMenu from "./EmojiMenu
import c from "../CSS/chatClasses.module.css"
import Message from "./Message"

function ChatWindow({ chatID, chatName, chatColor, setChatData, userID, user }) {

    const [chatState, setChatState] = useState("closed");



    const chatColorStyle = {
        backgroundImage: `linear-gradient(135deg, ${chatColor[0]}, ${chatColor[1]})`
    }
    // Placeholder content that will be replaced by backend data
    // Message ID, Chat ID, Sender ID, Time Stamp, Message
    const pulledMsgs = [
        [1, 2, 0, new Date(2023,10,6,18,53,30), "This is a test"],
        [2, 2, 2, new Date(2023,10,6,18,53,33), "I agree"],
        [3, 2, 2, new Date(2023,10,6,18,53,50), "..."],
        [4, 4, 3, new Date(2023,10,6,19,53,40), "This belongs on its own"],
        [5, 2, 0, new Date(2023,10,6,20,53,40), "Lorem ipsum, dolor sit amet consectetur adipisicing elit. Iure a, libero voluptatum illum corporis soluta nihil deleniti aliquam vitae, hic nisi. Omnis eum fugiat accusantium iste qui temporibus. Nulla, adipisci?"],
        [5, 2, 3, new Date(2023,10,6,20,53,41), "The endoplasmic reticulum does not harbor an ATP-regeneration machinery, and therefore requires ATP import from mitochondria. The imported ATP is vital for the ER to carry out its house keeping cellular functions, such as for protein folding and trafficking."],
        [5, 2, 0, new Date(2023,10,6,20,53,42), "Men's synchronized 10 metre platform event at the 2019 European Diving Championships was contested on 8 August."],
        [5, 2, 0, new Date(2023,10,6,20,53,43), "No railway was ever built through Oteramika, but at one point, the Kapuka railway station on the Tokanui Branch was named Oteramika. This station opened on 1 March 1895, closed to passengers on 1 June 1960, and closed to all traffic on 31 March 1966."],
        [5, 2, 0, new Date(2023,10,6,20,53,44), `Portlaoise were the defending champions after they defeated Ballylinan in the previous years final. They successfully defended their title to claim a "2-in-a-row" of victories when they defeated O'Dempsey's in this years final.\nEmo made a straight return to the senior grade after just one year outside the top flight.\nThis was the second season running in which Clonasleeâ€“St Manman's amalgamated with Annanough for their championship matches as Clonaslee Gaels (however unlike 2017, Annanough didn't field a side in the 2018 I.F.C.). Both clubs fielded separate reserve sides in the Laois J.F.C. 'C'. The amalgamation suffered relegation at the end of the 2018 campaign and so will ply their trade in the 2019 I.F.C.`],
    ];

    const getData = () => {
        const msgs = []
        let c = 0;
        for (let i = 0; i < pulledMsgs.length; i++) {
            if (pulledMsgs[i][1] === chatID) {
                msgs[c] = pulledMsgs[i];
                c++;
            }
        }
        return msgs;
    }
    const msgs = getData().map((x) => {
        return  <Message
                    key={x[0]}
                    sentBy={x[2]}
                    userID={userID}
                    chatColor={chatColor}
                    timeStamp={x[3]}
                    msg={x[4]}
                    />
    });
    
    if (chatID === "closed") {
        return (
            <div className={c.greeting}>
                    <div className={c.logo}></div>
                    <h2>Welcome, {user}</h2>
                    <p>Click on a chat to get started</p>
            </div>
        );
    }
    else if (chatID === "createChat") {
        return(
            <div>Create Chat Menu goes here</div>
        );
    }
    else {

        return (
            <div className={c.chatWrapper} style={chatColorStyle}>
                <div className={c.chatHeader}>
                    <h2>{chatName}</h2>
                    <button className={c.chatClose} onClick={()=>{setChatData("closed", "", ["#fff", "#fff"]);}}></button>
                    <button className={c.chatSettings} onClick={()=>{setChatData("closed", "", ["#fff", "#fff"]);}}></button>
                </div>
                <div className={c.chatHistory}>
                    {msgs}
                </div>

                <div className={c.messageBoxWrap}>
                    <div className={c.toolBar}></div>
                    <div className={c.messageBoxSeparator}>
                        <hr />
                    </div>
                    <textarea className={c.messageBox} name="msgBox" id="msgBox" placeholder="Type your message here..."></textarea>
                    {/* <EmojiMenu typeEmoji={typeEmoji} /> */}
                </div>
            </div>
        );
    }
}

export default ChatWindow;
